import React from "react";
import MainButton from "../components/MainButton";
import { NavLink } from "react-router-dom";

const OnBoardingCard = props => {
  console.log("hey this is what were looking for ", props.image);
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        padding: "10px"
      }}
    >
      <NavLink
        to="/market"
        style={{
          alignSelf: "flex-end",
          margin: "0 0 25px 0"
        }}
      >
        <i className="material-icons">clear</i>
      </NavLink>
      <div
        // className="grey lighten 3 z-depth-2"
        // style={{
        //   height: "40vh",
        //   width: "80vw"
        // }}
      />

        <img src={props.image1} style=
      {{Width:"20rem",
        height:"20rem"}}/>

        <img src={props.image2} style=
      {{Width:"20rem",
        height:"20rem"}}/>

        <img src={props.image3} style=
      {{Width:"20rem",
        height:"20rem",
        margin:"0 0 0 0"}}/>

      <h4 className="center-align">{props.title}</h4>
      <article
        style={{
          margin: "30px 0"
        }}
      >
        {props.tag}
      </article>
      <MainButton path={props.path} text="Learn More" />
    </div>
  );
};

export default OnBoardingCard;
